import React from 'react';

import Facing from './Facing';
import Card from '../UI/Card';
import './Shelf.css';

const Shelf = (props) => {
  return (
    <Card className='shelf'>
      {props.planograms.map((planogram) => (
        <Facing 
        upc={planogram.upc} 
        shelf={planogram.shelf} 
        gondula={planogram.gondula}
        />
      ))}


    </Card>
  );
}

export default Shelf;
